import { useState } from "react";

const Hello = function () {
  const [name, setName] = useState("Mike");
  function changeName() {
    name = name === "Mike" ? "Jane" : "Mike";
  }
  return (
    <div>
      <h1>State</h1>
      <h2>{name}</h2>
      <button onClick={changeName}>Change name</button>
    </div>
  );
};

export default Hello;
